"""内置图标模块
包含应用程序图标的base64编码数据
"""

import base64
import io
from PIL import Image

# 图标的base64编码数据
ICON_BASE64 = """"""

def get_icon_data():
    """获取图标的二进制数据"""
    return base64.b64decode(ICON_BASE64)

def get_icon_image():
    """获取PIL Image对象"""
    icon_data = get_icon_data()
    return Image.open(io.BytesIO(icon_data))

def save_icon_to_file(filepath):
    """将图标保存到文件"""
    with open(filepath, 'wb') as f:
        f.write(get_icon_data())
